const FieldRenderer = (props) => {
  const [inputVal, setInputVal] = useState("");
  return (
    <div className="field">
      <span>{props.label}</span>
      <input onChange={(e) => setInputVal(e.target.value)} />
    </div>
  );
};

const Login = () => {
  return (
    <div className="login">
      <FieldRenderer label="Нэвтрэх нэр:" ph="Нэвтрэх нэр" />
      <FieldRenderer label="Нууц үг:" ph="Нууц үг" />
      <button>Нэвтрэх</button>
    </div>
  );
};

export default Login;
